import React, { Component } from 'react';
import "react-router";
import {BrowserRouter as Router, Link} from "react-router-dom/Link";
import {Navbar, Nav, NavDropdown} from 'react-bootstrap';

import "./nav.css";




class ReactNav extends Component {
    constructor(props) {
        super(props);
      }
      render() {
        return (
            <Navbar expand="md" variant="dark">
            <Navbar.Brand href="/" className="text-white" ><h1>Commons2Floor3</h1></Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">

            <Router>
              <Nav className="ml-auto">
                <li className="nav-item active">
                    <Nav.Link className="nav-link">
                        <Link to="/home">
                            Home
                        </Link>
                    </Nav.Link>
                </li>
                <li className="nav-item">
                <Nav.Link className="nav-link" href="#home">Meet The Team</Nav.Link>
                </li>
                <li className="nav-item">
                <Nav.Link className="nav-link" href="#home">Dashboard</Nav.Link>
                </li>
                <li className="nav-item ">
                <Nav.Link className="nav-link" href="#home">Contact</Nav.Link>
                </li>
              </Nav>
            </Router> 
            </Navbar.Collapse>
          </Navbar>
        );
    }
}



  export default ReactNav;
